import { BottomNavigation, BottomNavigationAction, Button } from '@mui/material'
import React from 'react'
import FolderIcon from '@mui/icons-material/Folder';
import HomeIcon from '@mui/icons-material/Home';
import MapsUgcIcon from '@mui/icons-material/MapsUgc';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const Footer = () => {
  return (
      <BottomNavigation type sx={{ width: 500 }} >
               <Button color="inherit">{<HomeIcon fontSize='large'/>}</Button>

               <Button color="inherit">{<MapsUgcIcon fontSize='large'/>}</Button>
               <Button color="inherit">{<MapsUgcIcon fontSize='large'/>}</Button>

               <Avatar
              className={styles.Avatar}
              alt="Remy Sharp"
              sx={{ width: 77, height: 77 }}
              src={image}
            />

      <BottomNavigationAction
        label="Nearby"
        value="nearby"
        icon={<LocationOnIcon />}
      />
      <BottomNavigationAction label="Folder" value="folder" icon={<FolderIcon />} />
    </BottomNavigation>
  )
}

export default Footer
